 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';

 const Mainproduct = () => {


const listItem=product_cart.map((item)=>
<Box className="body" sx={{ backgroundColor:"black"}} >
<Box className="cart" key={item.id} sx={{backgroundColor:"red"}}>
<Box  className="cart_img "sx={{backgroundColor:"yellow",width:"200px"}} >
<img src={item.thumb} alt="Logo"  />
</Box>

<Box classname="card_header" sx={{backgroundColor:"purple"}}>
<div>{item.name}</div>
<p>{item.description}</p>
<p className="price"><span>{item.price}</span></p>
<div className="consult item" sx={{backgroundColor:"orange"}}></div>

</Box>

    </Box>
    </Box>
 );




return (
  
      <Box className="main_content" sx={{display:"flex",
    justifycontent: "center",
    alignItems:"center"}}  >
          {listItem}
      </Box>
     
      
  
);
}

 export default  Mainproduct;
